        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_length_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_length_words)

def specialFilter(nums):
    def is_odd_and_greater_than_10(n):
        if n <= 10:
            return False
        str_n = str(abs(n))
        return int(str_n[0]) % 2 != 0 and int(str_n[-1]) % 2 != 0

    return sum(1 for num in nums if is_odd_and_greater_than_10(num))

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    index1, index2 = planets.index(planet1), planets.index(planet2)
    if index1 < index2:
        return tuple(planets[index1+1:index2])
    else:
        return tuple(planets[index2+1:index1])

def max_fill(grid, capacity):
    import math
    total_water_units = sum(sum(row) for row in grid)
    return math.ceil(total_water_units / capacity)

def sort_array(arr):
    """
    Sort an array of integers in ascending order.
    """
    return sorted(arr)

def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start = max(interval1[0], interval2[0])
    end = min(interval1[1], interval2[1])
    if start > end:
        return "NO"
    length = end - start  # Adjusted to correctly calculate the length of the intersection
    return "YES" if is_prime(length) else "NO"

def order_by_points(nums):
    """
    Sorts the given list of integers in ascending order according to the sum of their digits.
    If there are several items with similar sum of their digits, order them based on their index in original list.
    """
    return sorted(nums, key=lambda x: (sum(int(d) for d in str(x) if d.isdigit()), nums.index(x)))

def do_algebra(operator, operand):
    """
    Given two lists operator, and operand. The first list has basic algebra operations, and 
    the second list is a list of integers. Use the two given lists to build the algebric 
    expression and return the evaluation of this expression.
    """
    expression = str(operand[0])
    for op, num in zip(operator, operand[1:]):
        expression += f" {op} {num}"
    return eval(expression)

def x_or_y(n, x, y):
    if n < 2:
        return y
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return y
    return x

def cycpattern_check(a, b):
    if len(b) > len(a):
        return False
    for i in range(len(b)):
        rotated_b = b[i:] + b[:i]
        if rotated_b in a:
            return True
    return False

def even_odd_count(num):
    num_str = str(abs(num))
    even_count = sum(1 for digit in num_str if int(digit) % 2 == 0)
    odd_count = sum(1 for digit in num_str if int(digit) % 2 != 0)
    return (even_count, odd_count)

def right_angle_triangle(a, b, c):
    sides = sorted([a, b, c])
    return sides[0]**2 + sides[1]**2 == sides[2]**2

def eat(number, need, remaining):
    """
    Returns the total number of eaten carrots after meals and the number of carrots left after meals.
    """
    if remaining >= need:
        return [number + need, remaining - need]
    else:
        return [number + remaining, 0]

def solve(s):
    if all(not c.isalpha() for c in s):
        return s[::-1]
    else:
        return ''.join(c.lower() if c.isupper() else c.upper() if c.islower() else c for c in s)

import hashlib

def string_to_md5(text):
    """
    Given a string 'text', return its md5 hash equivalent string.
    If 'text' is an empty string, return None.

    >>> string_to_md5('Hello world') == '3e25960a79dbc69b674cd4ec67a72c62'
    """
    if text == "":
        return None
    else:
        return hashlib.md5(text.encode()).hexdigest()
